import React, { Component } from 'react';

class Name extends Component {
  componentWillReceiveProps() {
    this.setState({
      stateValue: this.props.nameValue,
    });
  }

  render() {
    return <input type="text" value={this.props.nameValue} />;
  }
}

export default Name;
